హిల్లరీ వద్ద పదకొండు నాణేలు ఉన్నాయి, ఇవన్నీ డైమ్స్ మరియు నికెల్స్. మొత్తం, నాణేలు 75 సెంట్లు విలువైనవి. ఆమె వద్ద ఎన్ని నికెల్స్ ఉన్నాయి?

సమాధానం: డైమ్స్ విలువ 10 సెంట్లు, నికెల్స్ విలువ 5 సెంట్లు. అందువల్ల, డైమ్స్ మరియు నికెల్స్ యొక్క మొత్తం విలువ 10 + 5 = 15 సెంట్లు. మొత్తం నాణేలు 75 సెంట్లు విలువు ఉన్నాయి, కాబట్టి, నికెల్స్ యొక్క సంఖ్య = 75 / 5 = 15.

\boxed{15}
